import React from 'react';
import '../../styles/experiencecard.scss';

interface ExperienceCardProps {
    title: string;
    company: string;
    location: string;
    link: string;
    duration: string;
    description: string;
    skills: string[];
  }

  const ExperienceCard: React.FC<ExperienceCardProps> = ({ title, company, location, link, duration, description, skills }) => {
    return (
      <div className="experience-card">
        <div className="experience-header">
          <div className="title-company">
            <h2>{title} @ {company}</h2>
          </div>
          <div className="duration">
            <p>{duration}</p>
          </div>
        </div>
        <div className="experience-body">
          <p className="location"><i className="fas fa-map-marker-alt"></i> {location}</p>
          <a href={`http://${link}`} className="company-link" target="_blank" rel="noopener noreferrer">{link}</a>
          <p className="description">{description}</p>
          <div className="skills">
            {skills.map((skill, index) => (
              <span key={index} className="skill-tag">{skill}</span>
            ))}
          </div>
        </div>
      </div>
    );
  };
  
  export default ExperienceCard;
export default ExperienceCard;
